import React from 'react'
import { Link } from "react-router-dom";
import { Container } from "react-router-dom";
import { FaFacebookF , FaTwitter , FaInstagram, FaPinterestP, FaGooglePlusG } from 'react-icons/fa';

export const Footer = () => {
    return (
        <div className="ic-footer-wraper ic-pt-60 ic-pb-60">
            {/* <div className="ic-container"> */}
                <ul className="ic-footer-social">
                    <li>
                        <Link to="/"><FaFacebookF /></Link>
                    </li>
                    <li>
                        <Link to="/"><FaTwitter /></Link>
                    </li>
                    <li>
                        <Link to="/"><FaInstagram /></Link>
                    </li>
                    <li>
                        <Link to="/"><FaPinterestP /></Link>
                    </li>
                    <li>
                        <Link to="/"><FaGooglePlusG /></Link>
                    </li>
                </ul>
                <p className="ic-footer-text">Lorem Ipsum is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the industry's standard dummy text ever since the 1500s, when an unknown printer took a galley of type and scrambled it to make a type specimen book.</p>
            {/* </div> */}

            
        </div>
    )
}
